import './App.css';

function App() {
  return (
    <div className="App">
      <h1>Henry Food</h1>
      <form>
    <label>
      Name:
      <input type="text" name="name" placeholder='Buscar...'/>
    </label>
    <input type="submit" value="Submit" />
    </form>
    </div>
  );
}

export default App;
